import React, { Component } from 'react';
import HeaderAfterLogin from '../../../components/user/HeaderAfterLogin'
import { MDBContainer } from "mdbreact";
import ListProductCart from './ListProductCart';
import PaymentCart from './PaymentCart';

class Cart extends Component {
    render() {
        return (
            <div>
                <header>
                    <HeaderAfterLogin />
                </header>
                <main>
                    <MDBContainer size="">
                        <section class="mt-5 mb-4">
                            <div class="row">
                                <div class="col-lg-8">
                                    <div class="card wish-list mb-4">
                                        <ListProductCart />
                                    </div>

                                </div>
                                <div class="col-lg-4">
                                    <div class="card mb-4">
                                        <PaymentCart/>
                                    </div>
                                </div>
                            </div>
                        </section>
                    </MDBContainer>
                </main>
            </div>
        );
    }
}

export default Cart;
